import React from 'react';
import NavbarTop from './NavbarTop';
import lessonincomplete from '../img/lessonincomplete.svg';
import lessonicon from '../img/lessonicon.svg';
import '../App.css';

export default function Dashboard() {
	return (
		<article>
			<header>
				<NavbarTop />
			</header>
			<body>
				<image
					src={lessonicon}
					// style={{ position: 'absolute', height: '500vmin' }}
				/>
				<div style={styles.container}>
					<LessonElement />
				</div>
			</body>
		</article>
	);
}

function LessonElement() {
	return (
		<div style={styles.container}>
			<img src={lessonincomplete} style={styles.lessonElement} />
			<image
				src={lessonicon}
				// style={{ position: 'absolute', height: '500vmin' }}
			/>
			<p
				style={
					(styles.defaultFontFamily, { fontWeight: '700', color: '#606f7bff' })
				}
			>
				Basics training
			</p>
		</div>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonElement: {
		height: '15vmin'
	},
	container: {
		minHeight: '100vh',
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		justifyContent: 'center',
		fontSize: 'calc(10px + 2vmin)'
	}
};
// export default Dashboard;
